 package com.venada.efinance.pojo;import java.util.Date;public class DoubleEleven {	private String id;	private String nickname;	private Double sumdeposit;	private Date createtime ;	private Date addtime;	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public Double getSumdeposit() {		return sumdeposit;	}	public void setSumdeposit(Double sumdeposit) {		this.sumdeposit = sumdeposit;	}	public Date getAddtime() {		return addtime;	}	public void setAddtime(Date addtime) {		this.addtime = addtime;	}	public String getNickname() {		return nickname;	}	public void setNickname(String nickname) {		this.nickname = nickname;	}	public Date getCreatetime() {		return createtime;	}	public void setCreatetime(Date createtime) {		this.createtime = createtime;	}	}